import * as React from 'react'
import { Pages } from '../../models'

type Props = {
  LoginComponent: React.ElementType
}

function Login({ LoginComponent }: Props) {
  return (
    <main>
      <h1>Login</h1>
      <LoginComponent />
    </main>
  )
}

Login.displayName = Pages.Login

export { Login }
